import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-67c153b3631d4",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/mobike/Documents/songyp/github/blog/docs/README.md").then(comp => {
        Vue.component("v-67c153b3631d4", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-e91a4e0f8587b",
    path: "/algorithm/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/mobike/Documents/songyp/github/blog/docs/algorithm/README.md").then(comp => {
        Vue.component("v-e91a4e0f8587b", comp.default)
        next()
      })
    }
  },
  {
    path: "/algorithm/index.html",
    redirect: "/algorithm/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
